import React, { Component } from 'react'
import styles from "./carousel.module.css";

export class Card extends Component {


    render() {
        return (
            <div class="card">
            <img class="carousel-img" src="https://picsum.photos/200/300" />
            <div class="text-overlay">Design & Engineering</div>
          </div>
        )
    }
}



export default Card
